def binary_search(arr, key):
    """"""
    (low, high) = (0, len(arr) - 1)
    while low <= high:
        mid = low + (high - low) // 2
        if arr[mid] == key:
            return mid
        elif arr[mid] > key:
            high = mid - 1
        else:
            low = mid + 1
    return -1
